import React from "react";
import ReactDom from "react-dom/client";
import "./App.css";
import spotifyIcon from "./images/Spotify_icon.svg";

const Header = () => {
  return (
    <header className="header-container">
      <img src={spotifyIcon} alt="icon" />
      <p>ArtistBlender</p>
      {/* Change to link aftewards */}
      <>About</>
    </header>
  );
};
const ArtistBlender = () => {
  return (
    <div className="title-container">
      <h1 className="artistblender">ArtistBlender</h1>
      <p>Select your favorite artists and enjoy and their shuffled songs</p>
    </div>
  );
};

const App = () => {
  return (
    <main className="app">
      <Header />
      <ArtistBlender />
    </main>
  );
};

export default App;
